-- ----------------------------
-- Table structure for user
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user`  (
  `phone` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '手机号作为主键',
  `nick_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户昵称',
  `email` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '用户邮箱，用于接收验证码，不能为空',
  `role` int(4) NOT NULL DEFAULT 0 COMMENT '0学生，1教师，2管理员',
  `school_num` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '-1' COMMENT '学号',
  `school_id` int(11) NOT NULL DEFAULT -1 COMMENT '用户所在学校id',
  `password` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '用户名密码，密文',
  `state` int(4) NOT NULL DEFAULT 1 COMMENT '0表示封号，1表示正常使用',
  `image` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户头像',
  `face_login` int(4) NOT NULL DEFAULT 0 COMMENT '是否开启人脸登录；0未开启，1开启',
  `face_token` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'face_token，加密',
  `create_time` datetime(0) NOT NULL COMMENT '创建时间',
  `update_time` datetime(0) NOT NULL COMMENT '修改时间',
  `deleted` int(4) NOT NULL DEFAULT 0 COMMENT '逻辑删除(0表示未删除，1表示删除)',
  `version` int(255) NOT NULL DEFAULT 0 COMMENT '乐观锁',
  PRIMARY KEY (`phone`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

